using namespace std;

vector<string> separate_paren_groups(string paren_string) {
    string processed;
    for (char c : paren_string) {
        if (c != ' ') {
            processed.push_back(c);
        }
    }

    vector<string> result;
    string current_group;
    int depth = 0;

    for (char c : processed) {
        if (c == '(') {
            if (depth == 0) {
                current_group.clear();
            }
            current_group += c;
            depth++;
        } else if (c == ')') {
            current_group += c;
            depth--;
            if (depth == 0) {
                result.push_back(current_group);
                current_group.clear();
            }
        }
    }

    return result;
}

