string longest(vector<string> strings) {
    if (strings.empty()) {
        return "";
    }
    string result = strings[0];
    int max_len = result.size();
    for (size_t i = 1; i < strings.size(); ++i) {
        const string& current = strings[i];
        int current_len = current.size();
        if (current_len > max_len) {
            max_len = current_len;
            result = current;
        }
    }
    return result;
}

