string string_xor(string a, string b) {
    int max_len = max(a.size(), b.size());
    if (a.size() < max_len) {
        a = string(max_len - a.size(), '0') + a;
    }
    if (b.size() < max_len) {
        b = string(max_len - b.size(), '0') + b;
    }
    string result;
    for (int i = 0; i < max_len; ++i) {
        if (a[i] != b[i]) {
            result += '1';
        } else {
            result += '0';
        }
    }
    return result;
}

