vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;
    vector<string> groups;
    stringstream ss(paren_string);
    string group;

    // Split the input string into groups separated by spaces, ignoring empty groups
    while (getline(ss, group, ' ')) {
        if (!group.empty()) {
            groups.push_back(group);
        }
    }

    // Process each group to find the maximum depth
    for (const auto& g : groups) {
        int current_depth = 0;
        int max_depth = 0;
        for (char c : g) {
            if (c == '(') {
                current_depth++;
                if (current_depth > max_depth) {
                    max_depth = current_depth;
                }
            } else if (c == ')') {
                current_depth--;
            }
        }
        result.push_back(max_depth);
    }

    return result;
}

