float mean_absolute_deviation(vector<float> numbers) {
    if (numbers.empty()) {
        return 0.0f;
    }
    float sum = 0.0f;
    for (float num : numbers) {
        sum += num;
    }
    float mean = sum / numbers.size();
    float absolute_sum = 0.0f;
    for (float num : numbers) {
        absolute_sum += fabs(num - mean);
    }
    return absolute_sum / numbers.size();
}

#undef NDEBUG
#include<assert.h>
