vector<int> factorize(int n) {
    vector<int> factors;
    if (n == 1) {
        return factors; // Returns empty vector for n=1
    }
    // Handle the factor 2
    while (n % 2 == 0) {
        factors.push_back(2);
        n /= 2;
    }
    // Check for odd factors starting from 3
    for (int i = 3; i * i <= n; i += 2) {
        while (n % i == 0) {
            factors.push_back(i);
            n /= i;
        }
    }
    // If remaining n is a prime number greater than 2
    if (n > 1) {
        factors.push_back(n);
    }
    return factors;
}

