vector<int> sort_third(vector<int> l) {
    vector<int> res = l;
    vector<int> to_sort;

    // Collect elements at indices divisible by 3
    for (int i = 0; i < res.size(); ++i) {
        if (i % 3 == 0) {
            to_sort.push_back(res[i]);
        }
    }

    // Sort the collected elements
    sort(to_sort.begin(), to_sort.end());

    // Replace the elements in the result vector
    int sorted_index = 0;
    for (int i = 0; i < res.size(); ++i) {
        if (i % 3 == 0) {
            if (sorted_index < to_sort.size()) {
                res[i] = to_sort[sorted_index++];
            }
        }
    }

    return res;
}

