#include <stdio.h>

int fizz_buzz(int n) {
    int total = 0;
    for (int i = 1; i < n; ++i) {
        if (i % 11 == 0 || i % 13 == 0) {
            int count = 0;
            int num = i;
            while (num > 0) {
                int digit = num % 10;
                if (digit == 7) {
                    count++;
                }
                num /= 10;
            }
            total += count;
        }
    }
    return total;
}

