bool is_prime(long long num) {
    if (num <= 1) return false;
    if (num <= 3) return true;
    if (num % 2 == 0 || num % 3 == 0) return false;
    for (long long i = 5; i * i <= num; i += 6) {
        if (num % i == 0 || num % (i + 2) == 0)
            return false;
    }
    return true;
}

int prime_fib(int n) {
    int count = 0;
    long long a = 0, b = 1;
    while (true) {
        if (is_prime(a)) {
            count++;
            if (count == n) {
                return a;
            }
        }
        long long next = a + b;
        a = b;
        b = next;
    }
}

