using namespace std;

double poly(vector<double> xs, double x) {
    double sum = 0.0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double find_zero(vector<double> xs) {
    double a = -1.0;
    double b = 1.0;
    double fa = poly(xs, a);
    double fb = poly(xs, b);

    if (fa == 0.0) return a;
    if (fb == 0.0) return b;

    while (fa * fb > 0) {
        a *= 2.0;
        b *= 2.0;
        fa = poly(xs, a);
        fb = poly(xs, b);
        if (fa == 0.0) return a;
        if (fb == 0.0) return b;
    }

    double low, high;
    if (fa < 0.0) {
        low = a;
        high = b;
    } else {
        low = b;
        high = a;
    }

    const double epsilon = 1e-12;
    for (int i = 0; i < 100; ++i) {
        double mid = (low + high) / 2.0;
        double fmid = poly(xs, mid);
        if (fmid == 0.0) {
            return mid;
        }
        if (fmid < 0.0) {
            low = mid;
        } else {
            high = mid;
        }
        if (high - low < epsilon) {
            break;
        }
    }

    return (low + high) / 2.0;
}

// Example usage (as mentioned in the problem statement)
// 
#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

