#include <stdio.h>

int modp(int n, int p) {
    if (p == 1) {
        return 0;
    }
    int result = 1;
    int base = 2 % p;
    int exponent = n;
    while (exponent > 0) {
        if (exponent % 2 == 1) {
            result = (result * base) % p;
        }
        exponent = exponent >> 1;
        base = (base * base) % p;
    }
    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (modp(3, 5) == 3);
    assert (modp(1101, 101) == 2);
    assert (modp(0, 101) == 1);
    assert (modp(3, 11) == 8);
    assert (modp(100, 101) == 1);
    assert (modp(30, 5) == 4);
    assert (modp(31, 5) == 3);
}

