int largest_prime_factor(int n) {
    int largest = 1;
    int i = 2;
    while (i * i <= n) {
        while (n % i == 0) {
            largest = i;
            n /= i;
        }
        i++;
    }
    if (n > 1) {
        largest = n;
    }
    return largest;
}

