vector<int> common(vector<int> l1, vector<int> l2) {
    // Sort and deduplicate the first list
    sort(l1.begin(), l1.end());
    auto last = unique(l1.begin(), l1.end());
    l1.erase(last, l1.end());

    // Sort and deduplicate the second list
    sort(l2.begin(), l2.end());
    last = unique(l2.begin(), l2.end());
    l2.erase(last, l2.end());

    vector<int> res;
    int i = 0, j = 0;
    while (i < l1.size() && j < l2.size()) {
        if (l1[i] == l2[j]) {
            res.push_back(l1[i]);
            i++;
            j++;
        } else if (l1[i] < l2[j]) {
            i++;
        } else {
            j++;
        }
    }
    return res;
}

