string circular_shift(int x, int shift) {
    string s = to_string(x);
    int len = s.size();

    if (shift > len) {
        reverse(s.begin(), s.end());
        return s;
    } else {
        int k = shift;
        string part1 = s.substr(len - k, k);
        string part2 = s.substr(0, len - k);
        return part1 + part2;
    }
}

