vector<int> pluck(vector<int> arr) {
    if (arr.empty()) {
        return {};
    }

    int min_val = -1;
    int index = -1;

    for (int i = 0; i < arr.size(); ++i) {
        int num = arr[i];
        if (num % 2 == 0) {
            if (min_val == -1) {
                min_val = num;
                index = i;
            } else if (num < min_val) {
                min_val = num;
                index = i;
            }
        }
    }

    if (min_val == -1) {
        return {};
    } else {
        return {min_val, index};
    }
}

