int search(vector<int> lst) {
    unordered_map<int, int> freq;
    for (int num : lst) {
        freq[num]++;
    }
    int max_val = -1;
    for (auto& pair : freq) {
        int num = pair.first;
        int count = pair.second;
        if (count >= num && num > max_val) {
            max_val = num;
        }
    }
    return max_val;
}

