vector<int> strange_sort_list(vector<int> lst) {
    sort(lst.begin(), lst.end());
    vector<int> res;
    int left = 0;
    int right = lst.size() - 1;
    bool take_left = true;

    while (left <= right) {
        if (take_left) {
            res.push_back(lst[left]);
            left++;
        } else {
            res.push_back(lst[right]);
            right--;
        }
        take_left = !take_left;
    }

    return res;
}

