bool will_it_fly(vector<int> q, int w) {
    int n = q.size();
    // Check if the vector is a palindrome
    for (int i = 0; i < n / 2; ++i) {
        if (q[i] != q[n - 1 - i]) {
            return false;
        }
    }
    // Calculate the sum of elements
    int sum = 0;
    for (int num : q) {
        sum += num;
    }
    // Check sum against maximum weight
    return sum <= w;
}

