bool is_simple_power(int x, int n) {
    if (x == 0) {
        return (n == 0);
    } else if (x == 1) {
        return (n != 0);
    }

    if (n == 0) {
        return false;
    }

    if (n == 1) {
        return false;
    }

    long long product = 1;
    while (true) {
        product *= n;
        if (product == x) {
            return true;
        }
        if (abs(product) > abs(x)) {
            break;
        }
    }

    return false;
}

