string decimal_to_binary(int decimal) {
    if (decimal == 0) {
        return "db0db";
    }
    string binary;
    int num = decimal;
    while (num > 0) {
        int remainder = num % 2;
        binary.push_back(remainder ? '1' : '0');
        num = num / 2;
    }
    reverse(binary.begin(), binary.end());
    return "db" + binary + "db";
}

