bool is_multiply_prime(int a) {
    if (a < 8) return false; // The smallest product of three primes is 2*2*2=8

    // Generate all primes under 100 using Sieve of Eratosthenes
    vector<int> primes;
    bool is_prime[101];
    fill_n(is_prime, 101, true);
    is_prime[0] = is_prime[1] = false;
    for (int i = 2; i * i <= 100; ++i) {
        if (is_prime[i]) {
            for (int j = i * i; j <= 100; j += i) {
                is_prime[j] = false;
            }
        }
    }
    for (int i = 2; i <= 100; ++i) {
        if (is_prime[i]) {
            primes.push_back(i);
        }
    }

    int sum = 0;
    int original_a = a; // To check if any factors remain after processing all primes
    for (int p : primes) {
        while (a % p == 0) {
            sum++;
            a /= p;
            if (sum > 3) {
                return false;
            }
        }
        if (a == 1) {
            break;
        }
    }

    if (a != 1) { // There's a prime factor greater than 100
        return false;
    }

    return sum == 3;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_multiply_prime(5) == false);
    assert (is_multiply_prime(30) == true);
    assert (is_multiply_prime(8) == true);
    assert (is_multiply_prime(10) == false);
    assert (is_multiply_prime(125) == true);
    assert (is_multiply_prime(3 * 5 * 7) == true);
    assert (is_multiply_prime(3 * 6 * 7) == false);
    assert (is_multiply_prime(9 * 9 * 9) == false);
    assert (is_multiply_prime(11 * 9 * 9) == false);
    assert (is_multiply_prime(11 * 13 * 7) == true);
}

