string anti_shuffle(string s) {
    vector<string> tokens;
    if (s.empty()) {
        return s;
    }

    string current_token;
    current_token += s[0];
    bool current_is_space = (s[0] == ' ');

    for (size_t i = 1; i < s.size(); ++i) {
        char c = s[i];
        bool c_is_space = (c == ' ');
        if (c_is_space == current_is_space) {
            current_token += c;
        } else {
            tokens.push_back(current_token);
            current_token = string(1, c);
            current_is_space = c_is_space;
        }
    }
    tokens.push_back(current_token);

    for (auto& token : tokens) {
        if (!token.empty() && token[0] != ' ') {
            sort(token.begin(), token.end());
        }
    }

    string result;
