string encrypt(string s) {
    string result;
    for (char c : s) {
        if (c >= 'a' && c <= 'z') {
            int shifted = (c - 'a' + 4) % 26;
            result += 'a' + shifted;
        } else if (c >= 'A' && c <= 'Z') {
            int shifted = (c - 'A' + 4) % 26;
            result += 'A' + shifted;
        } else {
            result += c;
        }
    }
    return result;
}

