string encode(string message) {
    string result;
    for (char c : message) {
        if (isalpha(c)) {
            // Swap the case of the character
            char swapped = isupper(c) ? tolower(c) : toupper(c);
            // Check if the swapped character is a vowel (case-insensitive)
            char lower = tolower(swapped);
            if (lower == 'a' || lower == 'e' || lower == 'i' || lower == 'o' || lower == 'u') {
                swapped += 2; // Replace vowel with the next two letters
            }
            result += swapped;
        } else {
            result += c; // Non-alphabetic characters are added as-is
        }
    }
    return result;
}

