vector<int> sort_array(vector<int> array) {
    vector<int> result = array;
    if (array.size() <= 1) {
        return result;
    }
    int first = array[0];
    int last = array.back();
    int sum = first + last;
    if (sum % 2 == 1) {
        sort(result.begin(), result.end());
    } else {
        sort(result.begin(), result.end());
        reverse(result.begin(), result.end());
    }
    return result;
}

