int is_bored(string S) {
    vector<string> sentences;
    int start = 0;
    for (int i = 0; i < S.size(); ++i) {
        if (S[i] == '.' || S[i] == '?' || S[i] == '!') {
            string sentence = S.substr(start, i - start);
            sentences.push_back(sentence);
            start = i + 1;
        }
    }
    if (start < S.size()) {
        sentences.push_back(S.substr(start));
    }

    int count = 0;
    for (string sentence : sentences) {
        size_t first = sentence.find_first_not_of(" \t\n\r");
        if (first == string::npos) {
            continue;
        }
        string trimmed = sentence.substr(first);

        vector<string> words;
        size_t pos = 0;
        while (pos < trimmed.size()) {
            size_t next = trimmed.find_first_of(" \t\n\r", pos);
            if (next == string::npos) {
                words.push_back(trimmed.substr(pos));
                break;
            }
            if (next != pos) {
                words.push_back(trimmed.substr(pos, next - pos));
            }
            pos = next + 1;
        }

        if (!words.empty() && words[0] == "I") {
            count++;
        }
    }
    return count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_bored("Hello world") == 0);
    assert (is_bored("Is the sky blue?") == 0);
    assert (is_bored("I love It !") == 1);
    assert (is_bored("bIt") == 0);
    assert (is_bored("I feel good today. I will be productive. will kill It") == 2);
    assert (is_bored("You and I are going for a walk") == 0);
}

