bool is_prime(int n) {
    if (n <= 1) return false;
    if (n == 2) return true;
    if (n % 2 == 0) return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0) return false;
    }
    return true;
}

int skjkasdkd(vector<int> lst) {
    int max_prime = -1;
    for (int num : lst) {
        if (is_prime(num) && num > max_prime) {
            max_prime = num;
        }
    }
    if (max_prime == -1) {
        return 0;
    }
    int sum = 0;
    int n = max_prime;
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

