bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) return false;

    bool is_first = true;
    bool required_case;

    for (const auto& pair : dict) {
        const string& key = pair.first;

        if (key.empty()) return false;

        bool all_lower = true;
        bool all_upper = true;

        for (char c : key) {
            if (!isalpha((unsigned char)c)) return false;
            if (islower((unsigned char)c)) {
                all_upper = false;
            } else {
                all_lower = false;
            }
        }

        if (!all_lower && !all_upper) return false;

        if (is_first) {
            required_case = all_lower;
            is_first = false;
        } else {
            if (required_case != all_lower) return false;
        }
    }

    return true;
}

