string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }
    int avg = (n + m) / 2;
    string binary;
    if (avg == 0) {
        return "0";
    }
    while (avg > 0) {
        int rem = avg % 2;
        binary = (rem ? "1" : "0") + binary;
        avg /= 2;
    }
    return binary;
}

