vector<string> words_string(string s) {
    vector<string> result;
    string current;
    for (int i = 0; i < s.size(); i++) {
        char c = s[i];
        if (c == ',' || c == ' ') {
            if (!current.empty()) {
                result.push_back(current);
                current.clear();
            }
            // Skip all consecutive separators
            while (i + 1 < s.size() && (s[i+1] == ',' || s[i+1] == ' ')) {
                i++;
            }
        } else {
            current += c;
        }
    }
    // Add the last word if any
    if (!current.empty()) {
        result.push_back(current);
    }
    return result;
}

