vector<int> f(int n) {
    vector<int> result;
    if (n <= 0) return result;
    int fact = 1;
    for (int i = 1; i <= n; ++i) {
        if (i % 2 == 0) {
            fact *= i;
            result.push_back(fact);
        } else {
            int sum = i * (i + 1) / 2;
            result.push_back(sum);
            fact *= i;
        }
    }
    return result;
}

