bool hasNoEvenDigits(int num) {
    while (num > 0) {
        int digit = num % 10;
        if (digit % 2 == 0) {
            return false;
        }
        num /= 10;
    }
    return true;
}

vector<int> unique_digits(vector<int> x) {
    vector<int> res;
    for (int num : x) {
        if (hasNoEvenDigits(num)) {
            res.push_back(num);
        }
    }
    sort(res.begin(), res.end());
    return res;
}

