using namespace std;

int sum_digits(int num) {
    if (num == 0) {
        return 0;
    }
    bool is_negative = num < 0;
    int abs_num = abs(num);
    vector<int> digits;
    while (abs_num > 0) {
        digits.push_back(abs_num % 10);
        abs_num /= 10;
    }
    reverse(digits.begin(), digits.end());
    if (is_negative) {
        digits[0] *= -1;
    }
    int sum = 0;
    for (int d : digits) {
        sum += d;
    }
    return sum;
}

int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        int s = sum_digits(num);
        if (s > 0) {
            count++;
        }
    }
    return count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (count_nums({}) == 0);
    assert (count_nums({-1, -2, 0}) == 0);
    assert (count_nums({1, 1, 2, -2, 3, 4, 5}) == 6);
    assert (count_nums({1, 6, 9, -6, 0, 1, 5}) == 5);
    assert (count_nums({1, 100, 98, -7, 1, -1}) == 4);
    assert (count_nums({12, 23, 34, -45, -56, 0}) == 5);
    assert (count_nums({-0, 1}) == 1);
    assert (count_nums({1}) == 1);
}

