vector<string> reverse_delete(string s, string c) {
    // Create a boolean array to mark characters to delete
    bool delete_chars[256] = {false};
    for (char ch : c) {
        delete_chars[static_cast<unsigned char>(ch)] = true;
    }

    // Build the filtered string by including characters not marked for deletion
    string filtered;
    for (char ch : s) {
        if (!delete_chars[static_cast<unsigned char>(ch)]) {
            filtered += ch;
        }
    }

    // Check if the filtered string is a palindrome by comparing it to its reverse
    string reversed = filtered;
    reverse(reversed.begin(), reversed.end());
    bool is_palindrome = (filtered == reversed);

    // Return the result as a vector of strings
    return {filtered, is_palindrome ? "True" : "False"};
}

