map<char, int> histogram(string test) {
    map<char, int> freq;
    for (char c : test) {
        if (c != ' ') {
            freq[c]++;
        }
    }
    map<char, int> result;
    if (freq.empty()) {
        return result;
    }
    int max_count = 0;
    for (auto &pair : freq) {
        if (pair.second > max_count) {
            max_count = pair.second;
        }
    }
    for (auto &pair : freq) {
        if (pair.second == max_count) {
            result[pair.first] = pair.second;
        }
    }
    return result;
}

