bool is_balanced(const string &s) {
    int balance = 0;
    for (char c : s) {
        if (c == '(') balance++;
        else balance--;
        if (balance < 0) return false;
    }
    return balance == 0;
}

string match_parens(vector<string> lst) {
    int sum_open = 0, sum_close = 0;
    for (string s : lst) {
        for (char c : s) {
            if (c == '(') sum_open++;
            else sum_close++;
        }
    }
    if (sum_open != sum_close) {
        return "No";
    }
    string s1 = lst[0];
    string s2 = lst[1];
    if (is_balanced(s1 + s2) || is_balanced(s2 + s1)) {
        return "Yes";
    } else {
        return "No";
    }
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (match_parens({"()(", ")"}) == "Yes");
    assert (match_parens({")", ")"}) == "No");
    assert (match_parens({"(()(())", "())())"}) == "No");
    assert (match_parens({")())", "(()()("}) == "Yes");
    assert (match_parens({"(())))", "(()())(("}) == "Yes");
    assert (match_parens({"()", "())"}) == "No");
    assert (match_parens({"(()(", "()))()"}) == "Yes");
    assert (match_parens({"((((", "((())"}) == "No");
    assert (match_parens({")(()", "(()("}) == "No");
    assert (match_parens({")(", ")("}) == "No");
    assert (match_parens({"(", ")"}) == "Yes");
    assert (match_parens({")", "("}) == "Yes" );
}

