bool valid_date(string date) {
    if (date.empty()) {
        return false;
    }
    if (date.size() != 10) {
        return false;
    }
    if (date[2] != '-' || date[5] != '-') {
        return false;
    }

    string mm_str = date.substr(0, 2);
    string dd_str = date.substr(3, 2);
    string yyyy_str = date.substr(6, 4);

    auto isDigits = [](const string &s) {
        for (char c : s) {
            if (!isdigit(c)) {
                return false;
            }
        }
        return true;
    };

    if (!isDigits(mm_str) || !isDigits(dd_str) || !isDigits(yyyy_str)) {
        return false;
    }

    int month = stoi(mm_str);
    int day = stoi(dd_str);
    int year = stoi(yyyy_str);

    if (month < 1 || month > 12) {
        return false;
    }

    if (month == 1 || month == 3 || month == 5 || month == 7 || month == 8 || month == 10 || month == 12) {
        if (day < 1 || day > 31) {
            return false;
        }
    } else if (month == 4 || month == 6 || month == 9 || month == 11) {
        if (day < 1 || day > 30) {
            return false;
        }
    } else {
        if (day < 1 || day > 29) {
            return false;
        }
    }

    return true;
}

