    sequence.push_back(current);
    while (current != 1) {
        if (current % 2 == 0) {
            current /= 2;
        } else {
            current = 3 * current + 1;
        }
        sequence.push_back(current);
    }

    vector<int> odds;
    for (int num : sequence) {
        if (num % 2 != 0) {
            odds.push_back(num);
        }
    }

    sort(odds.begin(), odds.end());
    return odds;
}

