string intersection(vector<int> interval1, vector<int> interval2) {
    int s1 = interval1[0], e1 = interval1[1];
    int s2 = interval2[0], e2 = interval2[1];

    int inter_start = max(s1, s2);
    int inter_end = min(e1, e2);

    if (inter_start > inter_end) {
        return "NO";
    }

    int len = inter_end - inter_start;

    if (len <= 0) {
        return "NO";
    }

    // Check if len is a prime number
    if (len <= 1) {
        return "NO";
    }
    if (len == 2) {
        return "YES";
    }
    if (len % 2 == 0) {
        return "NO";
    }
    for (int i = 3; i * i <= len; i += 2) {
        if (len % i == 0) {
            return "NO";
        }
    }
    return "YES";
}

