vector<string> split_words(string txt) {
    // Check for any whitespace characters
    bool has_whitespace = false;
    for (char c : txt) {
        if (isspace(c)) {
            has_whitespace = true;
            break;
        }
    }
    if (has_whitespace) {
        vector<string> result;
        istringstream iss(txt);
        string token;
        while (iss >> token) {
            result.push_back(token);
        }
        return result;
    }

    // Check for commas
    if (txt.find(',') != string::npos) {
        vector<string> result;
        size_t start = 0;
        size_t end = txt.find(',');
        while (end != string::npos) {
            result.push_back(txt.substr(start, end - start));
            start = end + 1;
            end = txt.find(',', start);
        }
        result.push_back(txt.substr(start));
        return result;
    }

    // Calculate the count of lowercase letters with odd ordinals
    int count = 0;
    for (char c : txt) {
        if (islower(c)) {
            int ord = c - 'a';
            if (ord % 2 == 1) {
                count++;
            }
        }
    }
    return {to_string(count)};
}

