bool is_sorted(vector<int> lst) {
    // Check if the list is sorted in non-decreasing order
    for (int i = 0; i < (int)lst.size() - 1; ++i) {
        if (lst[i] > lst[i+1]) {
            return false;
        }
    }

    // Check if any number appears more than twice
    unordered_map<int, int> counts;
    for (int num : lst) {
        counts[num]++;
    }

    for (auto& pair : counts) {
        if (pair.second >= 3) {
            return false;
        }
    }

    return true;
}

