int digits(int n) {
    int product = 1;
    bool has_odd = false;
    while (n > 0) {
        int digit = n % 10;
        if (digit % 2 != 0) {
            product *= digit;
            has_odd = true;
        }
        n /= 10;
    }
    return has_odd ? product : 0;
}

