vector<int> tri(int n) {
    if (n < 0) return {};

    int max_even = (n % 2 == 0) ? n : n + 1;
    int size = max_even + 1;
    vector<int> res(size, 0);

    // Compute even terms
    for (int i = 0; i <= max_even; i += 2) {
        res[i] = 1 + i / 2;
    }

    // Set tri(1) = 3 if within bounds
    if (1 <= max_even) {
        res[1] = 3;
    }

    // Compute odd terms from 3 up to max_odd
    int max_odd = (n % 2 == 1) ? n : n - 1;
    for (int i = 3; i <= max_odd; i += 2) {
        if (i + 1 <= max_even) { // Ensure i+1 is within bounds
            res[i] = res[i - 1] + res[i - 2] + res[i + 1];
        }
    }

    // Return the first n+1 elements
    return vector<int>(res.begin(), res.begin() + n + 1);
}

