vector<int> minPath(vector<vector<int>> grid, int k) {
    int N = grid.size();
    int x = 0, y = 0;
    int min_val = grid[0][0];

    // Find the starting cell with the minimum value
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            if (grid[i][j] < min_val) {
                min_val = grid[i][j];
                x = i;
                y = j;
            }
        }
    }

    vector<int> path;
    path.push_back(min_val);
    if (k == 1) return path;

    // Directions: up, down, left, right
    int dx[] = {-1, 1, 0, 0};
    int dy[] = {0, 0, -1, 1};

    for (int step = 1; step < k; ++step) {
        int next_x = x, next_y = y;
        int min_next = INT_MAX;

        // Check all four possible directions
        for (int d = 0; d < 4; ++d) {
            int nx = x + dx[d];
            int ny = y + dy[d];
            if (nx >= 0 && nx < N && ny >= 0 && ny < N) {
                int val = grid[nx][ny];
                if (val < min_next) {
                    min_next = val;
                    next_x = nx;
                    next_y = ny;
                }
            }
        }

        path.push_back(min_next);
        x = next_x;
        y = next_y;
    }

    return path;
}

