bool is_nested(string str) {
    int n = str.size();
    if (n < 4) return false;

    int first_open = -1;
    for (int i = 0; i < n; ++i) {
        if (str[i] == '[') {
            first_open = i;
            break;
        }
    }
    if (first_open == -1) return false;

    int second_open = -1;
    for (int i = first_open + 1; i < n; ++i) {
        if (str[i] == '[') {
            second_open = i;
            break;
        }
    }
    if (second_open == -1) return false;

    int first_close = -1;
    for (int i = second_open + 1; i < n; ++i) {
        if (str[i] == ']') {
            first_close = i;
            break;
        }
    }
    if (first_close == -1) return false;

    int second_close = -1;
    for (int i = first_close + 1; i < n; ++i) {
        if (str[i] == ']') {
            second_close = i;
            break;
        }
    }
    if (second_close == -1) return false;

    return true;
}

