bool check_if_last_char_is_a_letter(string txt) {
    if (txt.empty()) {
        return false;
    }

    char last_char = txt.back();
    if (!isalpha(last_char)) {
        return false;
    }

    int last = txt.size() - 1;
    int start = last;

    while (start > 0 && txt[start - 1] != ' ') {
        start--;
    }

    int length = last - start + 1;
    return length == 1;
}

