string fix_spaces(string text) {
    string result = "";
    int i = 0;
    int n = text.length();
    while (i < n) {
        if (text[i] != ' ') {
            result += text[i];
            i++;
        } else {
            int count = 0;
            while (i < n && text[i] == ' ') {
                count++;
                i++;
            }
            if (count <= 2) {
                result += string(count, '_');
            } else {
                result += '-';
            }
        }
    }
    return result;
}

