string file_name_check(string file_name) {
    // Check for exactly one dot
    size_t first_dot = file_name.find('.');
    if (first_dot == string::npos) {
        return "No";
    }
    size_t next_dot = file_name.find('.', first_dot + 1);
    if (next_dot != string::npos) {
        return "No";
    }

    // Split into name and extension parts
    string name_part = file_name.substr(0, first_dot);
    string ext_part = file_name.substr(first_dot + 1);

    // Check name part is not empty and starts with a letter
    if (name_part.empty()) {
        return "No";
    }
    char first_char = name_part[0];
    if (!((first_char >= 'A' && first_char <= 'Z') || (first_char >= 'a' && first_char <= 'z'))) {
        return "No";
    }

    // Check extension is valid
    if (ext_part != "txt" && ext_part != "exe" && ext_part != "dll") {
        return "No";
    }

    // Check digit count does not exceed three
    int digit_count = 0;
    for (char c : file_name) {
        if (c >= '0' && c <= '9') {
            digit_count++;
        }
    }
    if (digit_count > 3) {
        return "No";
    }

    return "Yes";
}

