bool is_prime(int n) {
    if (n <= 1) return false;
    if (n == 2) return true;
    if (n % 2 == 0) return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0) return false;
    }
    return true;
}

string words_in_sentence(string sentence) {
    vector<string> words;
    stringstream ss(sentence);
    string word;
    while (getline(ss, word, ' ')) {
        words.push_back(word);
    }

    vector<string> result;
    for (auto& w : words) {
        if (is_prime(w.length())) {
            result.push_back(w);
        }
    }

    string output;
    for (size_t i = 0; i < result.size(); ++i) {
        if (i == 0) {
            output = result[i];
        } else {
            output += " " + result[i];
        }
    }

    return output;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (words_in_sentence("This is a test") == "is");
    assert (words_in_sentence("lets go for swimming") == "go for");
    assert (words_in_sentence("there is no place available here") == "there is no place");
    assert (words_in_sentence("Hi I am Hussein") == "Hi am Hussein");
    assert (words_in_sentence("go for it") == "go for it");
    assert (words_in_sentence("here") == "");
    assert (words_in_sentence("here is") == "is");
}

