using namespace std;

bool simplify(string x, string n) {
    // Parse x into a/b
    size_t slash_pos = x.find('/');
    long long a = stoll(x.substr(0, slash_pos));
    long long b = stoll(x.substr(slash_pos + 1));

    // Parse n into c/d
    slash_pos = n.find('/');
    long long c = stoll(n.substr(0, slash_pos));
    long long d = stoll(n.substr(slash_pos + 1));

    // Simplify by cancelling common factors between a and d
    long long g1 = __gcd(a, d);
    a /= g1;
    d /= g1;

    // Simplify by cancelling common factors between c and b
    long long g2 = __gcd(c, b);
    c /= g2;
    b /= g2;

    // Check if the resulting denominator is 1
    return (b * d) == 1;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (simplify("1/5", "5/1") == true);
    assert (simplify("1/6", "2/1") == false);
    assert (simplify("5/1", "3/1") == true);
    assert (simplify("7/10", "10/2") == false);
    assert (simplify("2/10", "50/10") == true);
    assert (simplify("7/2", "4/2") == true);
    assert (simplify("11/6", "6/1") == true);
    assert (simplify("2/3", "5/2") == false);
    assert (simplify("5/2", "3/5") == false);
    assert (simplify("2/4", "8/4") == true);
    assert (simplify("2/4", "4/2") == true);
    assert (simplify("1/5", "5/1") == true);
    assert (simplify("1/5", "1/5") == false);
}

