int sumDigits(int n) {
    if (n == 0) return 0;
    bool isNegative = n < 0;
    string s = to_string(abs(n));
    int sum = 0;
    if (isNegative) {
        sum += -(s[0] - '0');
        for (int i = 1; i < s.size(); ++i) {
            sum += s[i] - '0';
        }
    } else {
        for (char c : s) {
            sum += c - '0';
        }
    }
    return sum;
}

vector<int> order_by_points(vector<int> nums) {
    vector<tuple<int, int, int>> elements;
    for (int i = 0; i < nums.size(); ++i) {
        int sum = sumDigits(nums[i]);
        elements.emplace_back(sum, i, nums[i]);
    }
    sort(elements.begin(), elements.end(), [](const tuple<int, int, int>& a, const tuple<int, int, int>& b) {
        if (get<0>(a) != get<0>(b)) {
            return get<0>(a) < get<0>(b);
        } else {
            return get<1>(a) < get<1>(b);
        }
    });
    vector<int> result;
    for (const auto& elem : elements) {
        result.push_back(get<2>(elem));
    }
    return result;
}

