int get_max_triples(int n) {
    int count0 = 0;
    if (n >= 2) {
        count0 = (n - 2) / 3 + 1;
    }
    int count1 = n - count0;

    long long triples0 = (count0 >= 3) ? (long long)count0 * (count0 - 1) * (count0 - 2) / 6 : 0;
    long long triples1 = (count1 >= 3) ? (long long)count1 * (count1 - 1) * (count1 - 2) / 6 : 0;

    return triples0 + triples1;
}

