int specialFilter(vector<int> nums) {
    int count = 0;
    for (int num : nums) {
        if (num <= 10) {
            continue;
        }
        int last = num % 10;
        int first = num;
        while (first >= 10) {
            first /= 10;
        }
        if (first % 2 != 0 && last % 2 != 0) {
            count++;
        }
    }
    return count;
}

