vector<string> bf(string planet1, string planet2) {
    vector<string> ordered = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
    int index1 = -1, index2 = -1;

    for (int i = 0; i < ordered.size(); ++i) {
        if (ordered[i] == planet1) index1 = i;
        if (ordered[i] == planet2) index2 = i;
    }

    if (index1 == -1 || index2 == -1) {
        return vector<string>();
    }

    int lower = min(index1, index2);
    int higher = max(index1, index2);

    if (higher - lower <= 1) {
        return vector<string>();
    }

    vector<string> result;
    for (int i = lower + 1; i <= higher - 1; ++i) {
        result.push_back(ordered[i]);
    }

    return result;
}

