long long double_the_difference(vector<float> lst) {
    long long sum = 0;
    for (float num : lst) {
        if (num < 0) {
            continue;
        }
        if (num != static_cast<float>(static_cast<int>(num))) {
            continue;
        }
        int val = static_cast<int>(num);
        if (val % 2 != 0) {
            sum += static_cast<long long>(val) * val;
        }
    }
    return sum;
}

