vector<int> even_odd_count(int num) {
    int even = 0, odd = 0;
    num = abs(num); // Handle negative numbers

    if (num == 0) {
        even = 1;
    } else {
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                even++;
            } else {
                odd++;
            }
            num /= 10;
        }
    }

    return {even, odd};
}

