bool right_angle_triangle(float a, float b, float c) {
    float a_sq = a * a;
    float b_sq = b * b;
    float c_sq = c * c;

    float max_sq = a_sq;
    if (b_sq > max_sq) max_sq = b_sq;
    if (c_sq > max_sq) max_sq = c_sq;

    float sum_other = (a_sq + b_sq + c_sq) - max_sq;

    return fabs(sum_other - max_sq) < 1e-5f;
}

