string solve(string s) {
    bool has_letters = false;
    for (char c : s) {
        if (isalpha(c)) {
            has_letters = true;
            break;
        }
    }
    if (!has_letters) {
        reverse(s.begin(), s.end());
    } else {
        for (char &c : s) {
            if (isalpha(c)) {
                if (islower(c)) {
                    c = toupper(c);
                } else {
                    c = tolower(c);
                }
            }
        }
    }
    return s;
}

