using namespace std;

int getPrecedence(const string& op) {
    if (op == "**") return 4;
    if (op == "*" || op == "//") return 3;
    if (op == "+" || op == "-") return 2;
    return -1; // Invalid operator
}

bool isRightAssociative(const string& op) {
    return op == "**";
}

vector<string> shuntingYard(const vector<string>& tokens) {
    vector<string> output;
    vector<string> stack;

    for (const string& token : tokens) {
        if (isdigit(token[0])) {
            output.push_back(token);
        } else {
            while (!stack.empty()) {
                const string& top_op = stack.back();
                int curr_prec = getPrecedence(token);
                int top_prec = getPrecedence(top_op);

                if (curr_prec == -1 || top_prec == -1) break;

                bool curr_assoc = isRightAssociative(token);
                bool condition = false;

                if (curr_assoc) {
                    condition = (curr_prec < top_prec);
                } else {
                    condition = (curr_prec <= top_prec);
                }

                if (condition) {
                    output.push_back(top_op);
                    stack.pop_back();
                } else {
                    break;
                }
            }
            stack.push_back(token);
        }
    }

    while (!stack.empty()) {
        output.push_back(stack.back());
        stack.pop_back();
    }

    return output;
}

int evaluateRPN(const vector<string>& rpn) {
    vector<int> stack;

    for (const string& token : rpn) {
        if (isdigit(token[0])) {
            stack.push_back(stoi(token));
        } else {
            if (stack.size() < 2) {
                return -1; // Invalid expression
            }
            int b = stack.back(); stack.pop_back();
            int a = stack.back(); stack.pop_back();
            int result;

            if (token == "+") {
                result = a + b;
            } else if (token == "-") {
                result = a - b;
            } else if (token == "*") {
                result = a * b;
            } else if (token == "//") {
                if (b == 0) return -1; // Division by zero
                result = a / b;
            } else if (token == "**") {
                if (a == 0 && b == 0) return -1; // Undefined 0^0
                result = 1;
                for (int i = 0; i < b; ++i) {
                    result *= a;
                }
            } else {
                return -1; // Invalid operator
            }
            stack.push_back(result);
        }
    }

    if (stack.size() != 1) return -1; // Invalid expression
    return stack.back();
}

int do_algebra(vector<string> operato, vector<int> operand) {
    if (operand.size() < 2) return -1; // Invalid input per problem statement

    vector<string> tokens;
    tokens.push_back(to_string(operand[0]));

    for (int i = 0; i < operato.size(); ++i) {
        tokens.push_back(operato[i]);
        tokens.push_back(to_string(operand[i + 1]));
    }

    vector<string> rpn = shuntingYard(tokens);
    return evaluateRPN(rpn);
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (do_algebra({"**", "*", "+"}, {2, 3, 4, 5}) == 37);
    assert (do_algebra({"+", "*", "-"}, {2, 3, 4, 5}) == 9);
    assert (do_algebra({"//", "*"}, {7, 3, 4}) == 8);
}

